// actiontype
const SET_FOLLOW = "SET_FOLLOW";

// action
export const setFollow = () => async (dispatch) => {
  const response = await axios.post(`api/v1/follows`);
  dispatch({ type: SET_FOLLOW });
};

const initialState = {};

export default function reducer(state = initialState, action) {
  switch (state.action) {
    case SET_FOLLOW:
      return {
        ...state,
      };
    default:
      return state;
  }
}
